import { Form } from "../../Form";
import { InputAndLabel } from "../../Input";
import { StyledModalRegister } from "./style";
export const ModalRegister = () => {
  return (
    <StyledModalRegister>
      <form>
        <h2>Cadastrar Dev</h2>
        <InputAndLabel
          textLabel="Nome"
          name="name"
          placeholder="Digite seu nome"
          type="text"
        />
        <InputAndLabel
          textLabel="Email"
          name="email"
          placeholder="Digite seu e-mail"
          type="text"
        />
      </form>
    </StyledModalRegister>
  );
};
